from itertools import groupby
from sympy.combinatorics.partitions import IntegerPartition
from sympy.utilities.iterables import partitions, multiset_permutations
def cond(t): return all(len(list(g))<k for k, g in groupby(t))
def a(n): return sum(1 for p in partitions(n) if 1 not in p for c in multiset_permutations(IntegerPartition(p).partition) if cond(c))
print([a(n) for n in range(30)]) # _Michael S. Branicky_, Oct 11 2025

